  [],\n\t\"revision_timestamp\": \"2016-07-27T22:54:42.732618\",\n\t\"name\": \"narrative-report-for-september-1937-valentine-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments for September of 1937. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, furbearers, predators, and reptiles- is also covered. The Refuge
  development and maintenance section discusses physical developments and collections
  and receipts. Resource management is outlined; topics include grazing and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses and Refuge
  participation. Photographs, a report on administration, and a summary of the long-time
  fire suppression and control program are attached.\",\n\t\"license_title\": \"License
